import React from "react";
import { LoginContainer } from "./styles";
import AppLogo from "../../../resources/logo.png";

function Login(props) {
  return <LoginContainer>
    <LoginLogo src={AppLogo}/>
  </LoginContainer>;
}
export default Login;
